import React from "react";

function Sum(){
    let number1 = 40
    let number2 = 4
    let sum = number1 + number2
    return sum
}

function Sub(){
    let n1 = 30
    let n2 = 3
    let sub = n1 +n2
    return sub
}

function Div(){
    let div1 = 10
    let div2 = 3
    let div = div1 + div2
    return div
}

function Mult(){
    let mult
    return mult
}

export default Sum;
export {Sub, Div, Mult};
